import React from "react";

const Results = ({ score, totalQuestions, userName }) => {
  return (
    <div className="results-container">
      <h2>Вітаємо, {userName}! Квіз завершено!</h2>
      <p>
        Ваш результат: {score} з {totalQuestions}
      </p>
      <div className="score-table">
        <h3>Таблиця результатів</h3>
        <table>
          <thead>
            <tr>
              <th>Ім'я</th>
              <th>Бали</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{userName}</td>
              <td>{score}</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Results;
